.principal {
    &-body {
        height: 100%;
        width: 100%;
        background: radial-gradient(#3498DB, #85C1E9);
        display: flex;
        justify-content: center;
        align-items: center;
        position: fixed;
    }

    &-container {
        width: 90%;
        height: 90%;
        background-color: white;
        box-sizing: border-box;
        border-radius: 2rem;
        padding: 2rem;
        overflow: auto;
    }
}

.input-search {
    position: relative;

    input {
        width: 100%;
        border-color: #3498DB;
    }

    i {
        position: absolute;
        font-size: 20px;
        color: #3498DB;
        top: 9px;
        right: 9px;
    }
}

.color{
    font-size: 24px;
    cursor: pointer;
    color: red;
}
